import React from "react"

import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'
import folder from './folder.jpg'

export default function Symbols() {

  return (
        <div id="each-icon">
              <img id="icons-pic" src={folder} alt="imp"></img>
            <p id="icon-name" >hello</p>
        </div>
    )
};
